import { BrowserRouter, Routes, Route } from 'react-router-dom'

import Navbar from './Navbar'
import Jeopardy from './Jeopardy';
import Hello from './Hello'

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route index element={<Hello />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
